  // my ustom hook
  useGetOtherUsers();

  const {otherUsers} = useSelector(store=>store.user)
  if(!otherUsers) return;
  return (
    <div className='overflow-y-scroll h-80'>
      {
        otherUsers?.map((user)=>{
          return ( <OtherUser key={user._id} />

          )
        })
      }

      <OtherUser/>
      <OtherUser/>
      <OtherUser/>
      <OtherUser/>
      <OtherUser/>
      <OtherUser/>
      <OtherUser/>
    </div>
  )
}

